import {Container, Nameh2, Statush2, Originh2, Genderh2, Speciesh2, Button} from "./cardStyle";
export default function Card(props) {
   return (
      <Container>
         <Button onClick={props.onClose}>X</Button>
         <Nameh2>{props.name}</Nameh2>
         <Statush2>{props.status}</Statush2>
         <Speciesh2>{props.species}</Speciesh2>
         <Genderh2>{props.gender}</Genderh2>
         <Originh2>{props.origin}</Originh2>
         <img src={props.image} alt='' />
      </Container>
   );
}
